import React from 'react';
import {Frame} from 'component/frame.jsx';
import {Table,Button,Modal, Input,Form,Icon,DatePicker} from 'antd';
import {moment} from 'moment';
import {PersonDatas,Columns} from '../../json/person.js'
import createBrowserHistory from "history/createBrowserHistory";
import {regExpConfig} from '../../config/regular.config.js';
import './base.css';
const FormItem = Form.Item;
const customHistory = createBrowserHistory();
const dateFormat = 'YYYY-MM-DD';


class Person extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            editBtn_enable : false,
            delBtn_enable : false,
            add_visible : false,
            edit_visible : false,
            del_visible : false

        }

    }

    handleAddClick=()=>{
        this.setState({
            add_visible : true
        })
        //handle
    }

    handleAddOK=()=>{
        this.setState({
            add_visible : false
        })
        //handle
    }

    handleAddCancel=()=>{
        this.setState({
            add_visible : false
        })
        //handle
    }

    handleSubmit = (e) => {
        e.preventDefault();
        this.props.form.validateFields((err, values) => {
          if (!err) {
            console.log('Received values of form: ', values);
          }
        });
      }

    getInput(key,rules,message){

        const { getFieldDecorator } = this.props.form;
        console.log(rules);
        return(
        <FormItem hasFeedback key = {key}>
            {
                getFieldDecorator(key,{
                    rules:[
                        {pattern: rules,message:message},
                    ]                    
                })(<Input type="text"/>)
            }
        </FormItem>
        )
    }



    AddModel(){

        const { getFieldDecorator } = this.props.form;
        return(
            <Modal
                title="新增人员"
                visible={this.state.add_visible}
                onOk={this.handleAddOK}
                onCancel={this.handleAddCancel}
            >

            <Form>
            姓名
            {this.getInput("name",regExpConfig.isText_20,"姓名不得大于20个字符")}
            年龄
            {this.getInput("age",regExpConfig.isInt,"姓名必须为整数")}
            地址
            {this.getInput("address",regExpConfig.isText_100,"地址不得大于100个字符")}
            爱好
            {this.getInput("hobbit",regExpConfig.isText_30,"爱好..")}
            生日
            <DatePicker defaultValue={moment('1998/01/01', dateFormat)} format={dateFormat} />

            </Form>

            </Modal>
        )
    }


    handleEditClick=()=>{
        this.setState({
            edit_visible : true
        })
        //handle
    }

    handleEditOK=()=>{
        this.setState({
            edit_visible : false
        })
        //handle
    }

    handleEditCancel=()=>{
        this.setState({
            edit_visible : false
        })
        //handle
    }

    EditModal(){
        return(
            <Modal
                title="修改"
                visible={this.state.edit_visible}
                onOk={this.handleEditOK}
                onCancel={this.handleEditCancel}
            >
                <h3>TODO</h3>
            </Modal>
        )
    }

    render(){

        const rowSelection = {
            onChange: (selectedRowKeys, selectedRows) => {
                console.log(`selectedRowKeys: ${selectedRowKeys}`, 'selectedRows: ', selectedRows);
            },
            onSelect: (record, selected, selectedRows) => {
                console.log(selectedRows);
                this.setState({
                    editBtn_enable: (selectedRows.length>0),
                    delBtn_enable : (selectedRows.length>0)
                })
            },
            onSelectAll: (selected, selectedRows, changeRows) => {
                console.log(selected, selectedRows, changeRows);
                this.setState({
                    editBtn_enable: (selectedRows.length>0),
                    delBtn_enable : (selectedRows.length>0)
                })
            },
        };





        return (
            <div >   
                <Frame history={customHistory} defaultOpenKey="datas" defaultSelectedKey="person"/>
                <div className="home_content">

                <div className="pserson_table">
                    <Button type="primary" onClick={this.handleAddClick}>新增</Button>
                    <Button type="primary" onClick={this.handleEditClick} disabled={!this.state.editBtn_enable}>修改</Button>
                    <Button type="primary" disabled={!this.state.delBtn_enable}>删除</Button>
                    {this.AddModel()}
                    {this.EditModal()}
                <Table  dataSource={PersonDatas} rowSelection={rowSelection} columns = {Columns}/>
                </div>
                </div>
            </div>
        )
    }
}

export default Person = Form.create()(Person);
